INSERT INTO `broadcast_services` (`id`, `title`, `group_id`, `subgroup_id`, `type_id`, `short_description`, `long_description`, `image`, `original_image_name`, `unit_price`, `max_slots`, `available_slots`, `used_slots`, `created_at`, `updated_at`, `created_by`, `updated_by`) VALUES
	(4, 'Non-equipped Regular Commentary position', NULL, NULL, NULL, 'This Position is located on the media tribune', '<p class="MsoNormal">This Position is located on the media tribune</p>\r\n<ul>\r\n<li class="MsoNormal">1 x desk for up to 3 people</li>\r\n<li class="MsoNormal">2 x TV Sets connected to the Broadcast /Media CATV system</li>\r\n<li class="MsoNormal">Broadcast Power</li>\r\n<li class="MsoNormal">Commentary position per number of matches</li>\r\n<li class="MsoNormal">Connection to Internet Access</li>\r\n</ul>', '1812294757250427223004non_equipped_regular_commentary_position.png', 'non_equipped_regular_commentary_position.png', 23.15, 8, 2, 6, '2025-04-23 07:14:25', '2025-10-01 08:57:54', NULL, 1),
	(5, 'Non-equipped Multilateral Interviews Positions', NULL, NULL, NULL, 'one interview per playing team, 90 seconds max each', '<p class="MsoNormal">A selection of multilateral interview positions is made available Live on the respective Team A/B Feed and Live/Delayed on the Tactical &amp; Additional Content Feed.&nbsp;(MePs need to bring their Live U)</p>\r\n<p class="MsoNormal">Interviews can only be booked and conducted by MePs whose national teams are playing in the given match, they are considered multilateral, meaning made for the benefit of the whole MeP community broadcasting the relevant Match.&nbsp;&nbsp; If not booked, these interviews will be made by a BRO Services Venue Manager.</p>\r\n<p class="MsoListParagraphCxSpFirst" style="text-indent: -.25in; mso-list: l0 level1 lfo1;"><!-- [if !supportLists]--><span style="font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings; mso-bidi-font-weight: bold;"><span style="mso-list: Ignore;">&sect;<span style="font: 7.0pt \'Times New Roman\';">&nbsp; </span></span></span><!--[endif]-->Team Arrival Multilateral Interview Position Brief interviews (one interview per playing team, 90 seconds max each) of coaches or assistant coaches may be conducted at the time of the team arrival. Interviews are captured by HB in front of the official backdrop. The signal is delivered available live on the respective Team A/B Feed and Live/Delayed on the Tactical &amp; Additional Content Feed. Reporter cannot be on camera (multilateral content). MeP&rsquo;s flag on the microphone is not authorized.</p>\r\n<p class="MsoListParagraphCxSpMiddle">&nbsp;</p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent: -.25in; mso-list: l0 level1 lfo1;"><!-- [if !supportLists]--><span style="font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;"><span style="mso-list: Ignore;">&sect;<span style="font: 7.0pt \'Times New Roman\';">&nbsp; </span></span></span><!--[endif]-->Half-Time Multilateral Flash Interview Position Flash interviews (90 seconds max each) of coaches or assistant coaches (no players) may be conducted at Half Time in the designated area near the tunnel. One interview per playing team may take place. Interviews are captured by HB in front of the official backdrop. Reporter cannot be on camera (multilateral content). MeP&rsquo;s flag on the microphone is not authorized.</p>\r\n<p class="MsoListParagraphCxSpMiddle">&nbsp;</p>\r\n<p class="MsoListParagraphCxSpMiddle" style="text-indent: -.25in; mso-list: l0 level1 lfo1;"><!-- [if !supportLists]--><span style="font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;"><span style="mso-list: Ignore;">&sect;<span style="font: 7.0pt \'Times New Roman\';">&nbsp; </span></span></span><!--[endif]-->Full-Time Multilateral Flash Interview Position Flash interviews (90 seconds max each) of players and/or coaches may be conducted at the end of the match in the designated area close to the pitch. Two interviews per playing team may take place (typically the coach and one player). Interviews are captured by HB in front of the official backdrop. Reporter cannot be on camera (multilateral content). MeP&rsquo;s flag on the microphone is not authorized.<!--[endif]--></p>\r\n<p class="MsoListParagraphCxSpMiddle"><img src="data:image/png;base64,"></p>\r\n<p class="MsoListParagraphCxSpMiddle">&nbsp;</p>\r\n<p class="MsoListParagraphCxSpLast">These interviews are usually free of charge.</p>', 'non_equipped_multilateral_interviews_position.png', NULL, 40.00, 9, 4, 5, '2025-04-23 07:16:28', '2025-09-08 09:42:28', NULL, 1),
	(7, 'This is a test', NULL, NULL, NULL, 'This Position is located on the media tribune', '- 1 x desk for up to 3 people\r\n- 2 x TV Sets connected to the Broadcast /Media CATV system\r\n- Broadcast Power\r\n- Commentary position per number of matches\r\n- Connection to Internet Access', 'non_equipped_regular_commentary_position.png', NULL, 50.00, 4, 4, 0, '2025-04-26 09:00:53', '2025-09-08 09:24:05', 1, 1),
	(8, 'headphones', NULL, NULL, NULL, 'black headphone for gaming', '<p>this is a test&nbsp; another test</p>', '5667894132504272231364.png', '4.png', 17.00, 0, 0, 0, '2025-04-26 17:28:38', '2025-05-23 20:08:51', 1, 1),
	(11, 'this is a test', NULL, NULL, NULL, 'short description of this lively and lovely swirling black chair', 'as\r\nasdlasd\r\nalskdfja', '16153167632504270920548.png', '8.png', 17.00, 0, 0, 0, '2025-04-27 06:20:11', '2025-05-23 20:09:07', 1, 1),
	(12, 'wifi with so many antenas', NULL, NULL, NULL, 'TV Interview Studios, located close to the dressing rooms. This facility is bookable on a dedicated basis, for post-match interviews until one hour after the Final Whistle', '<p class="MsoListParagraphCxSpFirst">Partially non equipped TV/Interview Studios, located close to the dressing rooms. This facility is bookable on a dedicated basis, for post-match interviews until one hour after the Final Whistle. Coaches or players may be interviewed, but only once they have completed any multilateral flash interview requirements.</p>\r\n<p class="MsoListParagraphCxSpMiddle">The service includes:</p>\r\n<ul>\r\n<li class="MsoListParagraphCxSpMiddle">&nbsp;Access in accordance with production plan approved</li>\r\n<li class="MsoListParagraphCxSpMiddle">&nbsp;TV lighting and backdrop &ndash;</li>\r\n<li class="MsoListParagraphCxSpMiddle">&nbsp;Power</li>\r\n<li class="MsoListParagraphCxSpMiddle">&nbsp;1 x table, 3 x chairs other equipment to be provided by the MeP.</li>\r\n</ul>\r\n<p class="MsoListParagraphCxSpLast">TV/Interview Studios are available on Match Day-1 for set-up purposes only.</p>', '74992682225042713352226.png', '26.png', 17.00, 3, 3, 0, '2025-04-27 10:33:08', '2025-08-28 07:20:40', 1, 1),
	(13, 'gaming machine', NULL, NULL, NULL, 'gaming machine for the elite', '<p class="MsoListParagraphCxSpFirst">Up to 4 positions, located on the Press Conference camera platform, can be booked on a per-match basis. These positions can only be used for post-match activities.</p>\r\n<p class="MsoListParagraphCxSpMiddle">The service includes:</p>\r\n<ul>\r\n<li class="MsoListParagraphCxSpMiddle">Access for 1 camera operator</li>\r\n<li class="MsoListParagraphCxSpMiddle">Power</li>\r\n</ul>\r\n<p class="MsoListParagraphCxSpLast"><span style="mso-spacerun: yes;">&nbsp;</span>Equipment to be provided by the MeP (1 camera max.)</p>\r\n<p class="MsoListParagraphCxSpLast"><img src="data:image/png;base64,"></p>\r\n<p class="MsoListParagraphCxSpLast">&nbsp;</p>', '70095392725042811074617.png', '17.png', 17.00, 20, 20, 0, '2025-04-28 08:07:46', '2025-09-08 09:24:11', 1, 1),
	(14, 'lkjlk', NULL, NULL, NULL, 'lkjlk', '<p>ffdd</p>', '37964587725042811544513.png', '13.png', 17.00, 0, 0, 0, '2025-04-28 08:53:02', '2025-05-23 20:09:07', 1, 1),
	(15, 'Non - equipped Pitch-Side Presentation Position', NULL, NULL, NULL, 'Pitch-Side Presentation Positions', '<p class="MsoNormal">Up to 4 Pitch-Side Presentation Positions are available at each venue behind the goal lines. From 3 hours until 15 minutes before Kick-Off, at Half-Time and after the Final Whistle, stand-ups are permitted. At Half-Time and after the Final Whistle, the positions can only be used once all players have left the playing area. Interviews of players or coaches are not allowed.</p>\r\n<p class="MsoListParagraphCxSpLast"><strong>Access and Power should be provided. The camera can stay during the match as a unilateral camera position.</strong></p>', '1785140862250505143909non_equipped_pitch_presentation_position.png', 'non_equipped_pitch_presentation_position.png', 17.00, 5, 5, 0, '2025-05-05 11:39:10', '2025-05-23 20:09:07', 1, 1),
	(17, 'Multi-Camera Football Live Broadcasting System  IDEAL SYSTEMS', NULL, NULL, NULL, 'In order to meet the budgetary and production requirements from FAS for three hundred football matches over five years, a complete re-think of the typical technologies used for live football production was necessary.', '<p>In 2021 Football Association of Singapore (FAS) signed a 5-year contract with Ideal Systems for the supply and build of a state-of-the-art multi-stadium live multi-camera production system and Intercoms systems for five football stadiums in Singapore. The system received FIFA&reg; certification and went live in early 2022 and includes cameras and video production equipment for five stadiums, two production control rooms, a TV studio, a server room, and commentary rooms. It supports two simultaneous venues and provides multiple live streams and signal transport to multiple broadcasters, OTT and social media platforms. The entire system is completely managed in-house by FAS ensuring that FAS is now a vertically integrated sports media organization with complete production and delivery control over its own content.&nbsp;<br>The key functions of the ViBox include. &nbsp;</p>\r\n<ol>\r\n<li>&nbsp; Mixing up to 16 inputs &nbsp;</li>\r\n<li>&nbsp; Gfx Keyer &nbsp;</li>\r\n<li>&nbsp; M/E capable &nbsp;</li>\r\n<li>Up to 14 records (12 cameras + Clean/Dirty) &nbsp;</li>\r\n<li>&nbsp;Instant Replay and Slow motion capabilities &nbsp;</li>\r\n<li>&nbsp; Customisable multi-function User Interface to support multiple users for different functions including (Vibox Live + Vibox Slomo + Ro + VAR operator +RRA 64x64 Audio integration in Dante&nbsp;</li>\r\n</ol>', '1802794304250825133853One-of-the-CJP-Broadcast-cameras-in-position-at-Stockport-County-FC-stadium-Edgeley-Park.jpg', 'One-of-the-CJP-Broadcast-cameras-in-position-at-Stockport-County-FC-stadium-Edgeley-Park.jpg', 55.00, 12, 7, 5, '2025-08-25 10:38:55', '2025-09-08 11:49:44', 1, 1),
	(18, 'Grass Valley tech', NULL, NULL, NULL, 'The modernization effort aligns with Qatar\'s Vision 2030 initiative', '<p>Key features of the renovation include the integration of Grass Valley&rsquo;s LDX 98 cameras, K-Frame Kayenne 4 M/E switchers, and Densit&eacute; processing equipment.</p>\r\n<p>These 4K-ready solutions represent the latest in broadcast technology and are designed to enhance production capabilities for news and talk shows, the core programming for Saudi One.</p>', '18431903282508261524307r403629-hdrlowA.jpg', '7r403629-hdrlowA.jpg', 45.00, 20, 14, 0, '2025-08-26 12:24:31', '2025-08-28 07:20:01', 1, 1),
	(19, 'Multi-screen app development', NULL, NULL, NULL, 'Delivering frontend solutions tailored for any OS, platform, and device', '<div class="content-block">\r\n<p>A client&rsquo;s aspiration to expand their subscriber base through multi-platform reach and leapfrog rivals with powerful frontend turned into a success project story, starring Oxagile:</p>\r\n<ul class="list2">\r\n<li><strong>Streaming far and wide. </strong>The app covers iOS, Android, Android TV, Apple TV, Samsung, LG, and STBs.</li>\r\n<li><strong>User engagement and convenience hand in hand. </strong>Mosaic viewing, parental controls, interactive EPGs, catch-up function, and much more.</li>\r\n<li><strong>Framework-driven approach to frontend app development. </strong>The solution favors fast and easy configurations.</li>\r\n</ul>\r\n</div>', '1480546233250827134135banner-2.jpg', 'banner-2.jpg', 35.00, 20, 20, 0, '2025-08-27 10:41:35', '2025-09-08 11:41:45', 1, 1),
	(20, 'rwerwerr', NULL, NULL, NULL, 'werrwerwrwerer', '<p>werrrrrrrrrrrwereyrty yryryrty<span style="text-decoration: underline;"> tryyrtytyrtyrtyrtyrtytryyrtyryrrtytyrtyrtyrtyrtyrty</span></p>', '629868154250907094941images.jpg', 'images.jpg', 5.00, 5, 1, 4, '2025-09-07 06:49:41', '2025-09-08 11:35:12', 1, 1);

